import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
        <>
      <div className="home-container">
        <h1>Welcome to Job Portal</h1>
        <p>Your one-stop solution for job searching and posting.</p>
        <p>Use the navigation above to explore profiles, post jobs, or view job listings.</p>
      </div>
      </>
    );
  }
}

export default Home;
